(1, 1, '2016-02-10 10:55:30', '2016-02-10 10:55:30', 'Bem-vindo ao WordPress. Esse é o seu primeiro post. Edite-o ou exclua-o, e então comece a escrever!', '', '', 'trash', 'open', 'open', '', 'ola-mundo', '', '', '2016-02-10 14:07:16', '2016-02-10 14:07:16', '', 0, 'http://localhost/altran/wordpress/?p=1', 0, 'post', '', 1),
(2, 1, '2016-02-10 10:55:30', '2016-02-10 10:55:30', 'Esta é uma página de exemplo. É diferente de um post porque ela ficará em um local e será exibida na navegação do seu site (na maioria dos temas). A maioria das pessoas começa com uma página de introdução aos potenciais visitantes do site. Ela pode ser assim:\n\n<blockquote>Olá! Eu sou um bike courrier de dia, ator amador à noite e este é meu blog. Eu moro em São Paulo, tenho um cachorro chamado Tonico e eu gosto de caipirinhas. (E de ser pego pela chuva.)</blockquote>\n\nou assim:\n\n<blockquote>A XYZ foi fundada em 1971 e desde então vem proporcionando produtos de qualidade a seus clientes. Localizada em Valinhos, XYZ emprega mais de 2.000 pessoas e faz várias contribuições para a comunidade local.</blockquote>\nComo um novo usuário do WordPress, você deve ir até o <a href="http://localhost/altran/wordpress/wp-admin/">seu painel</a> para excluir essa página e criar novas páginas com seu próprio conteúdo. Divirta-se!', '', '', 'trash', 'closed', 'open', '', 'pagina-exemplo', '', '', '2016-02-10 14:07:22', '2016-02-10 14:07:22', '', 0, 'http://localhost/altran/wordpress/?page_id=2', 0, 'page', '', 0),
